            if gar == '6' or gar >= '7':
                data = ser.read_until(b'\r')
                ranger = data[1:-1]
                ranger = bytes.decode(ranger)
                ranger = str(ranger)
                print("distance = ", ranger, "inches away..")
                sleep(3)
            sleep(0.1)

        except serial.SerialException as e:
            print(f"Error opening serial port: {e}")
            raise

    def sab(state=None):
        if state == "F":
            print ("Robot Moving Forward")
            try:
                saber.drive(1, 70)
                saber.drive(2, 70)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, -5)
                saber.drive(2, -5)
                pass

        if state == "R":
            print ("Robot Turning Right")
            try:
                saber.drive(1, 75)
                saber.drive(2, 25)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, -5)
                saber.drive(2, -5)
                pass

        if state == "L":
            print ("Robot Turning Left")
            try:
                saber.drive(1, 25)
                saber.drive(2, 75)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, -5)
                saber.drive(2, -5)
                pass

        if state == "S":
            print ("Robot Stopped")
            try:
                saber.drive(1, 0)
                saber.drive(2, 0)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, -5)
                saber.drive(2, -5)
                pass

        if state == "START":
            print("Starting from a stop...")
            saber.drive(1, True)
            saber.drive(2, True)

        if state == "REV":
            print("Reversing")
            try:
                saber.drive(1, -55)
                saber.drive(2, -55)
            except ranger <= '5':
                print("Accessing AI...")
                saber.drive(1, 5)
                saber.drive(2, 5)
                pass

        if state == "SPIN":
            print("Loops...")
            saber.drive(1, -55)
            saber.drive(2, 55)

        template_data = {
